import React from 'react';

class Order extends React.Component {
  render() {
    return(
      <div>
        <div>
          <p>Order status: Pending.</p>
        </div>

        <div>
          <img src="" alt="Avatar"/>
          <h1>Jorge <br/> Chirinos</h1>
        </div>

        <div>
          <p>Front end apprentice</p>
          <p>@chirinosjor</p>
        </div>

        <div>
          #personalProject
        </div>
      </div>
    )
  }
}

export default Order;
